import React from "react";
import {GoogleMap, Marker, withGoogleMap, withScriptjs} from "react-google-maps";
import {useDispatch, useSelector} from "react-redux";
import {getRouteStations} from "../redux/apiMobileV2/ApiMobileV2Action";
import logo from "../assets/img/station.svg";

export default function Maps() {
    const dispatch = useDispatch();
    const data = useSelector(state => state.apiMobileV2Reducer.routeStationsData);
    React.useEffect(() => {
        dispatch(getRouteStations(550));
    }, []);
    console.log("mylog", data);
    const stations = data ? data.kpp1 : 0;

    const CustomSkinMap = withScriptjs(withGoogleMap(() => (
            <GoogleMap
                defaultZoom={13}
                defaultCenter={{lat: 41.320052, lng: 69.253966}}
                defaultOptions={{
                    scrollwheel: false,
                    zoomControl: true,
                }}
            >
                {stations ? stations.map((item,index)=>
                    stations ? <Marker key={index++} visible={true} defaultTitle={"Station"} icon={logo} cursor={stations[index].sn} title={stations[index].sn} position={{lat: stations[index].lat, lng: stations[index].lng}}/> : ''
